import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex: 1;
  height: 100vh;

  background-color: ${({theme}) => theme.ice}
`;

export const SubtitleView = styled.div`
  display: flex;
  flex: 1;
  color: ${({ theme }) => theme.brandColorPrimary};
  font-size: 20px;
  line-height: 24px;

  background-color: green;
`;
